import React from "react";
import ReactDOM from "react-dom/client";
import { Routes, Route } from "react-router-dom";
import Home from "./Home"; // New landing page
import App from "./App"; // Admin App
import Usermain from "./Usermain"; // User App

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />  {/* Landing Page */}
        <Route path="/admin/*" element={<App />} />  {/* Admin Panel */}
        <Route path="/user/*" element={<Usermain />} />  {/* User Panel */}
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
